    iconClass: 'iconfont icon-bold',
    text: 'Bold',
    type: BOLD
  },
  [CODE]: {
    id: "seafile_".concat(CODE),
    iconClass: 'iconfont icon-code',
    text: 'Code',
    type: CODE
